__NUXT_JSONP__("/article/article-2", (function(a,b,c,d,e,f,g){return {data:[{}],fetch:{},mutations:[["setApp",{name:"Blog2",uid:"blog2",icon:{type:"emoji",value:"✌️"},cover:{type:"image",value:"https:\u002F\u002Fstorage.googleapis.com\u002Fnewt-images\u002F618884b9b2f01f00183628e7%2F61edf6d5ee0ab10018964218%2Fcovers%2F1663668937942%2Fblog2.jpg"}}],["setCurrentArticle",{_id:"61b1686732470a0018d79e97",_sys:{raw:{createdAt:a,updatedAt:"2022-10-13T10:27:59.748Z",firstPublishedAt:a,publishedAt:e},createdAt:a,updatedAt:e},title:"Fictitious Communityがパンデミックの間イベントをどのように主催したか",slug:"article-2",body:"\u003Ch2\u003EFictitiousコミュニティ\u003C\u002Fh2\u003E\n\u003Cp\u003Eコミュニティは常にFictitiousの中心でした。多くの人々がコミュニティに加わるにつれて、世界中のユーザーが独自のコミュニティを形成し始めまていました。\u003Cbr\u003E\nしかし、世界的なパンデミックがおき行動は制限されました。そんな中でもコミュニティは、世界中で素晴らしいイベントを何度も開催してくれました。\u003C\u002Fp\u003E\n\u003Cul\u003E\n\u003Cli\u003E4\u002F4 Fictitious Camp\u003C\u002Fli\u003E\n\u003Cli\u003E6\u002F9 Fictitious conference 2021\u003C\u002Fli\u003E\n\u003Cli\u003E9\u002F5 Meetup! Fictitious\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003Cp\u003E\u003Cstrong\u003Eオンラインイベントの大きなチャンスは、より多くのオーディエンスにリーチできること\u003C\u002Fstrong\u003E。コミュニティは以前にもまして国際的になり、予想外の成長を遂げました。\u003C\u002Fp\u003E\n\u003Ch2\u003EThank you\u003C\u002Fh2\u003E\n\u003Cp\u003E今年イベントに参加してくださった皆様、ありがとうございました。来年もこの取り組みを継続するために取り組んでいきます。今後のイベントにも是非参加してください。リスト\u003C\u002Fp\u003E\n",coverImage:{_id:"632993fa0ee571716d967187",altText:b,description:b,fileName:"avel-chuklanov-9OWS4lT5iqQ-unsplash.jpg",fileSize:253326,fileType:"image\u002Fjpeg",height:667,metadata:{},src:"https:\u002F\u002Fstorage.googleapis.com\u002Fnewt-files\u002F11924cc4-7afd-48c0-97c7-76f987e0fe26%2Favel-chuklanov-9OWS4lT5iqQ-unsplash.jpg",title:b,width:1000},author:{_id:"61a7359d8131ac001847fbb4",_sys:{raw:{createdAt:c,updatedAt:"2022-10-13T10:27:59.876Z",firstPublishedAt:c,publishedAt:f},createdAt:c,updatedAt:f},fullName:"Donna Thomason",slug:"donna-thomason",biography:"\u003Cp\u003E2020年にFictitiousを創業。前職のPetlassianではマーケティング責任者としてグローバル・マーケティングを担当し、オンライン販売モデルの構築・拡大に貢献\u003C\u002Fp\u003E",profileImage:null},tags:[{_id:"61a73adc6c236700180c0da8",_sys:{raw:{createdAt:d,updatedAt:"2022-10-13T10:28:00.209Z",firstPublishedAt:d,publishedAt:g},createdAt:d,updatedAt:g},name:"Community",slug:"community"}]}],["setPreviousArticle",{slug:"article-1"}],["setNextArticle",{slug:"article-3"}]]}}("2021-12-09T02:22:31.979Z","","2021-12-01T08:43:09.433Z","2021-12-01T09:05:32.437Z","2022-09-20T10:20:47.255Z","2022-02-17T04:05:10.247Z","2021-12-09T02:18:29.098Z")));